  [],\n\t\"revision_timestamp\": \"2015-05-07T03:49:31.575483\",\n\t\"name\": \"camber-configuration-control-for-performance-optimization-c3po-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"A novel actuation concept previously used
  for trailing edge tab control is to be extended for use in spanwise camber control
  for enhanced aerodynamic performance of next generation aircraft designs.  The key
  features of its low-power, two-position (bistable) nature and small size permit
  its application as secondary structure within wing assemblies, thereby allowing
  for flight-dependent customization of the spanwise camber to optimize vehicle aerodynamic
  efficiency.  The proposed Phase I program will leverage previous development success
  of the actuation concept to scale design applications for ultimate use on transport-category
  aircraft, and provide risk reduction via demonstration wind tunnel tests on a scaled
  wing half-span model.  A byproduct of the scaling law will be its incorporation
  within a Multidisciplinary Design Analysis and Optimization (MDAO) tool for ease
  of exploration of the actuation features in the context of novel vehicle configurations
  having flight control for performance adjustment.\",\n\t\"license_title\": \"U.S.
